import React from 'react'
import './ControlComponent.css';

const ControlComponent = () => {
    
    const handleSubmit = (e) => {
         e.preventDefault();
    }
  return (
    <div className='box'>
      <form onSubmit={handleSubmit}>
        <div>
            <label>Username:</label>
            <input type='text'/>
        </div>
        <div>
            <label>Password:</label>
            <input type='password'/>
        </div>
        <button>Login</button>
      </form>
    </div>
  )
}

export default ControlComponent;
